import './Navbar.css'

export const Navbar = () => {
    return (
        <nav>
            <div className="nav-wrapper grey darken-1">
                <a href="/" className="brand-logo"><img src="https://image.flaticon.com/icons/png/512/7/7487.png" alt="Home"/></a>
            </div>
            <ul className="">

            </ul>
        </nav>
    )
}
